    "# Memories: Photo Management for Nextcloud\n\nMemories is a *batteries-included* photo management solution for Nextcloud with advanced features including:\n\n- **📸 Timeline**: Sort photos and videos by date taken, parsed from Exif data.\n- **⏪ Rewind**: Jump to any time in the past instantly and relive your memories.\n- **🤖 AI Tagging**: Group photos by people and objects, powered by [recognize](https://github.com/nextcloud/recognize) and [facerecognition](https://github.com/matiasdelellis/facerecognition).\n- **🖼️ Albums**: Create albums to group photos and videos together. Then share these albums with others.\n- **🫱🏻‍🫲🏻 External Sharing**: Share photos and videos with people outside of your Nextcloud instance.\n- **📱 Mobile Support**: Work from any device, of any shape and size through the web app.\n- **✏️ Edit Metadata**: Edit dates and other metadata on photos quickly and in bulk.\n- **📦 Archive**: Store photos you don't want to see in your timeline in a separate folder.\n- **📹 Video Transcoding**: Transcode videos and use HLS for maximal performance.\n- **🗺️ Map**: View your photos on a map, tagged with accurate reverse geocoding.\n- **📦 Migration**: Migrate easily from Nextcloud Photos and Google Takeout.\n- **⚡️ Performance**: Do all this very fast.\n\n## 🚀 Installation\n\n1. Install the app from the Nextcloud app store (try a demo [here](https://demo.memories.gallery/apps/memories/)).\n1. Perform the recommended [configuration steps](https://memories.gallery/config/).\n1. Run `php occ memories:index` to generate metadata indices for existing photos.\n1. Open the 📷 Memories app in Nextcloud and set the directory containing your photos." : "# Memories: Fotohantering för Nextcloud\n\nMemories är en fotohanteringslösning för Nextcloud med *batterier inkluderade* och avancerade funktioner så som:\n\n- **📸 Tidslinje**: Sortera bilder och videor efter datum, taget från Exif-data.\n- **⏪ Spola tillbaka**: Hoppa till vilken tid som helst i det förflutna och återupplev dina minnen.\n- **🤖 AI Taggning**: Gruppera bilder efter personer och objekt, drivet av [recognize](https://github.com/nextcloud/recognize) och [facerecognition](https://github.com/matiasdelellis/facerecognition).\n- **🖼️ Album**: Skapa album för att samla bilder och videor. Dela sen dessa album med andra!\n- **🫱🏻‍🫲🏻 Extern delning**: Dela bilder och videor med personer utanför din Nextcloud-instans.\n- **📱Mobilstöd**: Arbeta från vilken enhet som helst, oberoende av form och storlek tack vare webbappen.\n- **✏️ Redigera metadata**: Ändra datum och annan metadata i bilder snabbt och i bulk.\n- **📦 Arkiv**: Lagra bilder du inte vill se i din tidslinje i en separat mapp.\n- **📹 Omkodning av video**: Koda om video och använd HLS för maximal prestanda.\n- **🗺️ Karta**: Visa dina bilder på en karta, taggade med träffsäker omvänd geolokalisering.\n- **📦 Migrering**: Migrera enkelt från Nextcloud Photos och Google Takeout.\n- **⚡️ Prestanda**: Gör allt detta mycket snabbt.\n\n## 🚀 Installation\n\n1. Installera appen från Nextclouds app-butik (testa en demo [här](https://demo.memories.gallery/apps/memories/)).\n1. Utför de rekommenderade [konfigurationsstegen](https://memories.gallery/config/).\n1. Kör `php occ memories:index` för att generera metadata-index för existerande bilder.\n1. Öppna 📷 Memories-appen i Nextcloud och välj mappen som innehåller dina bilder.",
